import React from "react";
import { titles } from "../../data/data";
import {
  Container,
  Primary,
  Header,
  User,
  UserName,
  Date,
  Search,
  Category,
  Title,
  Foods,
  FoodsHeader,
  FoodsTitle,
  Sort,
  FoodsMain,
} from "./HomeElements";
const Home = () => {
  return (
    <Container>
      <Primary>
        <Header>
          <User>
            <UserName>Jaegar Resto</UserName>
            <Date>Tuesday, 2Feb 2021</Date>
          </User>
          <Search>
            <i class="fa-solid fa-magnifying-glass"></i>
            <input type="search" placeholder="Search for food, coffe, etc.." />
          </Search>
        </Header>
        <Category>
          {titles.map((title) => {
           return <Title key={title.id} style={title.style}>
              {title.name}
            </Title>;
          })}
        </Category>
        <Foods>
          <FoodsHeader>
            <FoodsTitle>Choose Dishes</FoodsTitle>
            <Sort>
              <i class="fa-sharp fa-solid fa-chevron-down"></i> Dine in
            </Sort>
          </FoodsHeader>
          <FoodsMain></FoodsMain>
        </Foods>
      </Primary>
    </Container>
  );
};

export default Home;
